import React from 'react'

export default function Emergency() {
  return (
    <div className='btns'>
       <select onChange={(e)=>props.setEmergency(e.target.value)}>
        <option value={0}>100 A</option>
        <option value={1}>101 B</option>
        <option value={2}>102 C</option>
       </select>
    </div>
  )
}
